import React from 'react';
import { View,Text,StyleSheet, TouchableOpacity } from 'react-native';


export default function Teste5() {
  
 return (
   <View style={styles.container}>

     <Text>Teste 5</Text>
   </View>
  );
}

const styles = StyleSheet.create({
    container:{
        flex: 1,
        backgroundColor:'#38a69d'
    },

})
